import Rebase from 're-base';
import firebase from 'firebase';

const firebaseApp = firebase.initializeApp({
  apiKey: 'AIzaSyDWES6_xRFXK8NIFiZNMbisQa2BdlZTQgs',
  authDomain: 'catch-of-the-day-5001a.firebaseapp.com',
  databaseURL:
    'https://catch-of-the-day-5001a-default-rtdb.asia-southeast1.firebasedatabase.app',
});

const base = Rebase.createClass(firebaseApp.database());

//this a named export
export { firebaseApp };

//this is a default export
export default base;
